let TracesPlusPageviews = 
    traces 
    | union pageViews 
    | where timestamp between (_startTime .. _endTime)
    | count 
    | extend Desc = 'traces + pageViews'; 
let BaseCustomers = 
    allTraces 
    | count 
    | extend Desc = 'allTraces';
TracesPlusPageviews
| union BaseCustomers

externaldata(entraTenantId :string, tenantDescription:string)
        [h@'https://raw.githubusercontent.com/waldo1001/waldo.BCTelemetry/master/Azure%20Data%20Explorer/ExternalData/entraTenantId.json']
            with(format='multijson');

let entraTenantIdDescriptions = externaldata(entraTenantId :string, tenantDescription:string)
        [h@'https://raw.githubusercontent.com/waldo1001/waldo.BCTelemetry/master/Azure%20Data%20Explorer/ExternalData/entraTenantId.json']
            with(format='multijson');
let TempAllTraces = 
    traces
    | where message contains _MessageFilter
    | extend aadTenantId = tostring(customDimensions.aadTenantId)
    | where aadTenantId has_any (_entraTenantId);
entraTenantIdDescriptions
| join kind=rightouter TempAllTraces on $left.entraTenantId == $right.aadTenantId
| extend entraTenantId = tostring(aadTenantId)
| extend tenantDescription = iif(isempty(tenantDescription),tostring(aadTenantId),tenantDescription)
| summarize by tenantDescription

let entraTenantIdDescriptions = externaldata(entraTenantId :string, tenantDescription:string)
        [h@'https://raw.githubusercontent.com/waldo1001/waldo.BCTelemetry/master/Azure%20Data%20Explorer/ExternalData/entraTenantId.json']
            with(format='multijson')
| where tenantDescription has_any (_TenantDescription);
let Environments = 
    traces
    | where timestamp between (_startTime .. _endTime)
    | extend aadTenantId = tostring(customDimensions.aadTenantId)
    | extend environmentName = tostring(customDimensions.environmentName)
    | summarize by aadTenantId, environmentName;
Environments
| join kind=rightouter entraTenantIdDescriptions on $left.aadTenantId == $right.entraTenantId
| summarize by environmentName;
